    this.state = {
      items: [
        {
          id: 1,
          title: 'Cylinder',
          img: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.freepik.com%2Fpremium-vector%2Fgentleman-cylinder-hat-web-design-fashion-vintage-man-hat-festivals_22641282.htm&psig=AOvVaw35KUqqV-w3OPnbBODaTguR&ust=1677246630535000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCJDz9d7kq_0CFQAAAAAdAAAAABAR'
        }
      ]
    }
  }
  render () {
    return (
      <div className="wrapper">
        <Header />
        <Footer />
      </div>
    );
  }
}

export default App;
